    return await new Promise((resolve, reject) => {
        setTimeout(() => {
            resolve(t + 1);
        }, 1000)
    });
};


const p2 = async (t) => {
    console.log(t); // 9
    return await new Promise((resolve, reject) => {
        setTimeout(() => {
            resolve(t + 1);
        }, 1000)
    });
};


